03-29 20:16:24',NULL,1018),(2555,'소재:  고무, 산호양털','2019-03-29 20:16:24','2019-03-29 20:16:24',NULL,1018),(2556,'사용방법: \n\n1. 60~70도 정도의 뜨거운 물을 준비합니다.\n2. 찜질팩 마재를 연 후 입구 주변의 목을 고정시키고 끓인 물을 부어 넣습니다.\n3. 찜질팩에 약 2/3 가량의 물을 채워 넣어주세요.(화상방지를 위해 고무장갑 등의 착용을 권장합니다.)\n4. 물이 채워지지 않은 윗부분을 손으로 살짝 눌러 뜨거운 김을 내보냅니다.\n5. 마지막으로 마개를 잘 닫은 후, 입구부분에 묻은 물을 털어냅니다.\n6. 찜질팩을 거꾸로 들어 물이 새지 않는지 살펴본 후 사용합니다.\n','2019-03-29 20:16:24','2019-03-29 20:16:24',NULL,1018),(2557,'DESIGNED BY. JYJ','2019-03-29 20:16:24','2019-03-29 20:16:24',NULL,1018),(2558,'취급시 유의사항: \n\n*뜨거운 물을 사용하는 제품으로 안전에 주의하세요.\n*제품 사용 전 제품과 뚜껑에 이상이 없는지 확인하세요.\n*제품의 2/3 이하로 물을 채운 후 공기를 빼고 뚜껑을 닫아주세요.\n*장시간 사용하려면, 화상 방지를 위해 제품을 수건 등으로 감싼 후 사용하세요.\n*뜨거운 물이 든 제품을 쿠션처럼 사용하거나 깔고 앉으면 안됩니다.\n*제품을 사용하지 않은 경우, 물을 완전히 비우고 뚜껑을 열어 보관하세요.\n*직사광선을 피해 시원하고 건조한 곳에 보관하는 것을 권장합니다.\n*보관 시 제품 위에 다른 물건을 놓지 마세요.\n*기름이나 윤활유, 화기에 가까이 두지 마세요.\n*어린이의 손이 닿지 않는 곳에 보관하세요.\n*용도 외에는 사용하지 마세요.\n*80도 이상의 고온은 사용하지 마세요.\n','2019-03-29 20:16:24','2019-03-29 20:16:24',NULL,1018),(2559,'사이즈: 접었을 때 총길이:27cm/ 펼쳤을때 지름:96cm','2019-03-29 20:16:24','2019-03-29 20:16:24',NULL,1019),(2560,'재질:폴리에스터, 스틸, 알루미늄, ABS','2019-03-29 20:16:24','2019-03-29 20:16:24',NULL,1019),(2561,'designed by JSY','2019-03-29 20:16:24','2019-03-29 20:16:24',NULL,1019),(2562,'재질:폴리에스터,스틸,알루미늄,PU','2019-03-29 20:16:24','2019-03-29 20:16:24',NULL,1020),(2563,'사이즈: 접었을때 총길이:27.5cm/ 펼쳤을때 지름:85.5cm','2019-03-29 20:16:24','2019-03-29 20:16:24',NULL,1020),(2564,'designed by JHS','2019-03-29 20:16:24','2019-03-29 20:16:24',NULL,1020),(2565,'재질 : 나일론(벨크로)','2019-03-29 20:16:24','2019-03-29 20:16:24',NULL,1022),(2566,'사이즈 : 약 67(가로) x 60(세로) (mm)','2019-03-29 20:16:24','2019-03-29 20:16:24',NULL,1022),(2567,'주의사항:  \n- 지정된 용도 이외에 사용하지 마세요.\n- 영,유아의 손이 닿지 않는 곳에 보관하세요\n- 청결하고 건조한 곳에 보관하세요.\n','2019-03-29 20:16:24','2019-03-29 20:16:24',NULL,1022),(2568,'designed by KJY','2019-03-29 20:16:24','2019-03-29 20:16:24',NULL,1022),(2569,'규격:36x37cm','2019-03-29 20:16:24','2019-03-29 20:16:24',NULL,1021),(2570,'재질:면100%'