을 완전히 비우고 뚜껑을 열어 보관하세요.\n*직사광선을 피해 시원하고 건조한 곳에 보관하는 것을 권장합니다.\n*보관 시 제품 위에 다른 물건을 놓지 마세요.\n*기름이나 윤활유, 화기에 가까이 두지 마세요.\n*어린이의 손이 닿지 않는 곳에 보관하세요.\n*용도 외에는 사용하지 마세요.\n*80도 이상의 고온은 사용하지 마세요.\n','2019-03-29 20:16:24','2019-03-29 20:16:24',NULL,1031),(2605,'DESIGNED BY. JYJ','2019-03-29 20:16:24','2019-03-29 20:16:24',NULL,1031),(2606,'재질:폴리에스터, 알루미늄, FRP, PU','2019-03-29 20:16:24','2019-03-29 20:16:24',NULL,1034),(2607,'사이즈:접었을 때 총길이-29cm, 펼쳤을 때 지름- 100cm','2019-03-29 20:16:24','2019-03-29 20:16:24',NULL,1034),(2608,'손질방법 및 보존방법\n1.우산을 펼 때 좌우로 흔들어서 펴주십시오.\n2.사용 후 물기를 털고 그늘에서 말려서 보관하여주십시오.\n3.습기가 많은 곳에 보관하지마십시오.\n4.우산 중봉이 휘지않도록 주의하여주십시오.','2019-03-29 20:16:24','2019-03-29 20:16:24',NULL,1034),(2609,'Designed by Jidong28','2019-03-29 20:16:24','2019-03-29 20:16:24',NULL,1034),(2610,'재질:EVA,ABS,STEEL','2019-03-29 20:16:25','2019-03-29 20:16:25',NULL,1032),(2611,'designed by EDI','2019-03-29 20:16:25','2019-03-29 20:16:25',NULL,1032),(2612,'사이즈: 접었을때 총길이:76.5cm/ 펼쳤을때 지름:89.5cm','2019-03-29 20:16:25','2019-03-29 20:16:25',NULL,1032),(2613,'재질:겉감-폴리에스터50% ,면50%','2019-03-29 20:16:25','2019-03-29 20:16:25',NULL,1033),(2614,'사이즈:33.5x34.5cm','2019-03-29 20:16:25','2019-03-29 20:16:25',NULL,1033),(2615,'사용연령: 만14세이상','2019-03-29 20:16:25','2019-03-29 20:16:25',NULL,1033),(2616,'designed by EDI','2019-03-29 20:16:25','2019-03-29 20:16:25',NULL,1033),(2617,'원단혼용률:폴리에스터 100%','2019-03-29 20:16:25','2019-03-29 20:16:25',NULL,1035),(2618,'사이즈:FREE (기장: 약 96cm, 허리: 단면 30cm,고무줄 밴드 있음)','2019-03-29 20:16:25','2019-03-29 20:16:25',NULL,1035),(2619,'사용연령:14세이상','2019-03-29 20:16:25','2019-03-29 20:16:25',NULL,1035),(2620,'취급시 주의사항\n1.변색의 염려가 있으니 중성세제를 사용하세요.\n2.세제가 제품에 닿으면 부분탈색 될 우려가 있으므로 세제를 완전히 용해하여 세탁하세요.\n3.물이나 땀에 젖은 상태로 오래 방치하지마세요.\n4.물에 오래 담가두지마시고 즉시 탈수 건조하세요.\n5.세탁시 탈색 및 수축이 생길 수 있으니 주의하세요.\n6.혼용세탁하지 마시고 단독 세탁하세요.\n7.세탁 후 건조시 소재의 손상 및 수축현상이 발생할 수 있으므로 반드시 자연건조하십시오.\n','2019-03-29 20:16:25','2019-03-29 20:16:25',NULL,1035),(2621,'Designed by Jidong28','2019-03-29 20:16:25','2019-03-2