 깨끗한 물로 씻고 이상이 있을 경우 의사와 상의 하세요.\n5) 내용물을 먹거나 삼킨 경우 응급조치를 하고 즉시 의사와 상의하세요.\n6) 왁스가 하얗게 변하거나 들뜨는 현상, 수축으로 인한 갈라짐, 표면의 이슬맺힘 현상등은 제품 특성으로 안심하고 사용하세요.\n7) 온도와 습기에 약한 제품으로 직사광선이나 열기, 화기에 직접 노출시키지 마세요.\n8) 장기간 사용하지 않을 때에는 서늘한 곳에 밀봉하여 보관하세요.\n9) 낙하 또는 부주의로 인한 파손에 주의하시고, 이로 인해 내용물이 누출된 경우에는 즉시 깨끗한 물로 닦아 주세요.\n10) 내용물이 다른물체(플라스틱, 천, 가죽등)와 닿으면 변색 및 탈색의 우려가 있으므로 주의하세요.\n11) 사용줄 어지럽거나 두통 등의 증상을 보이는 경우에는 사용을 중지하고 환기가 잘되는 곳에서 안정을 취하세요.\n12) 유, 소아, 어린이나 반려동물의 손이 닿지 않는 곳에 두고 사용하세요.\n','2019-03-29 20:24:24','2019-03-29 20:24:24',NULL,1748),(4443,'규격:5cmX9.3cmX1cm','2019-03-29 20:24:24','2019-03-29 20:24:24',NULL,1746),(4444,'재질:PP','2019-03-29 20:24:24','2019-03-29 20:24:24',NULL,1746),(4445,'사용상 주의사항:화기에 가까이 두지 마세요','2019-03-29 20:24:24','2019-03-29 20:24:24',NULL,1746),(4446,'designed by Ko\n','2019-03-29 20:24:24','2019-03-29 20:24:24',NULL,1746),(4447,'성분:탈이온수','2019-03-29 20:24:24','2019-03-29 20:24:24',NULL,1749),(4448,'용량:300ml','2019-03-29 20:24:24','2019-03-29 20:24:24',NULL,1749),(4449,'주의사항\n1. 용도 외에는 사용하지 마세요. \n2. 신체용 향수가 아닙니다. 사람이나 음식물에 직접 분사하지 마세요. \n3. 용기와 결합된 뚜껑을 억지로 벗기지 마세요. \n4. 제품이 얼었을 경우 변질 우려가 있으니 상온에서 사용하세요. \n5. 내용물이 눈이나 피부에 닿으면 깨끗한 물로 씻고 이상이 있을 경우 의사와 상의하세요. \n6. 넘어진 채로 방치되면 액이 흘러나올 수 있으므로 주의하세요. \n7. 변색, 탈색 등의 우려가 있는 곳에 사용 시 눈에 띄지 않는 부위에 \n사전 변색, 탈색 등의 유무를 확인한 후 사용하세요.\n8. 사용 후 잔량은 잘못 사용될 우려가 있으므로 원래의 용기에 보관하세요. \n9. 내용물을 먹거나 삼킨 경우 응급조치를하고 즉시 의사와 상의하세요.','2019-03-29 20:24:24','2019-03-29 20:24:24',NULL,1749),(4450,'Designed by ARTBOX in KOREA','2019-03-29 20:24:25','2019-03-29 20:24:25',NULL,1749),(4451,'전성분:정제수, 소듐코코피지-다이모늄클로라이드포스페이트, 소듐아니세이트, 소듐벤조에이트, 소듐시트레이트, 카프릴하이드록사믹애씨드, 소듐바이카보네이트, 알로에베라잎추출물, 라임전초오일','2019-03-29 20:24:25','2019-03-29 20:24:25',NULL,1754),(4452,'중량:36g(10매)','2019-03-29 20:24:25','2019-03-29 20:24:25',NULL,1754),(4453,'제조번호 및 사용기한:별도표기','2019-03-29 20:24:25','2019-03-29 20:24:25',NULL,1754),(4454,'주의사항 : \n1) 화장품 사용 시 또는 사용 후 직사광선에 의하여 사용부위가 붉은 반점, 부어오름 또는 가려움증 등의 이상증상이나 부작용이 있는 경우 전문의 등과 상담할 것 \n2) 상처가 있는 부위 등에는 사용을 자제할 것 \n3) 보관 및 취급 