8:55','2019-03-29 20:28:55',NULL,2162),(5619,'원산지 : MADE IN CHINA','2019-03-29 20:28:55','2019-03-29 20:28:55',NULL,2162),(5620,'제조원 : GUANGZHOU FAD FAN ELECTRONICS CO.,LTD.','2019-03-29 20:28:55','2019-03-29 20:28:55',NULL,2162),(5621,'KC마크/등록번호: R-REI-BOX-26-015912','2019-03-29 20:28:55','2019-03-29 20:28:55',NULL,2162),(5622,'#사용방법\n1. 가습기 몸체부분과 뚜껑을 잡은 뒤, 시계방향으로 회전하여 뚜껑을 열어줍니다.\n2. 뚜껑 바닥면에 있는 필터홀더를 뺀 후 적혀두었던 필터를 몸체 안에 넣습니다.\n3. 필터 홀더를 다시 커버 바닥면에 끼워준 후 물통에 물을 채운 뒤, \n   커버를 시계 반대방향으로 돌려 빠지지 않도록 닫아줍니다. \n4. usb 케이블을 연결한 뒤 전원 버튼을 가볍게 터치해 줍니다.\n5. 한번 버튼을 터치하면 상태표시등이 변하며 조명과 가습이 켜집니다.\n   두번 터치하면 조명이 꺼지며, 세번 터치하면 가습도 꺼집니다.\n6. 새 기기나 오래 사용하지 않은 기기는 약 3분정도 가습이 시작되지 않습니다.\n   이것은 일반적인 현상이고, 필터에 물이 흡수되는 시간입니다.\n   필터가 물에 흠뻑 젖으면 곧 가습이 시작됩니다.','2019-03-29 20:28:55','2019-03-29 20:28:55',NULL,2161),(5623,'#주의사항\n\n1. 용도 이외에 사용하지 마시고, 어린이에게 닿지 않는 장소에 보관하세요.\n2. 기기가 손상되거나 사용기간에 영향을 미치므로 물 없이 작동시키지 마세요.\n3. 무해하고 깨끗한 가습을 위해 수돗물을 사용하세요. (뜨거운 물 사용금지)\n4. 분무칩의 표면 손상방지를 위해 날카롭고 단단한 물건으로 분무칩을 건드리지 마세요.\n5. 분사구는 부드러운 천을 사용해 닦아주세요.\n6. 기기를 장시간 사용하지 않는다면(3일이상) 전원을 뽑고,\n   물을 비우고 닦아 보관하세요.\n7. 기기전체를 액체에 담그지 마세요.\n8. 휘발유, 알코올 또는 유기용제를 사용하지 마세요.','2019-03-29 20:28:55','2019-03-29 20:28:55',NULL,2161),(5624,'#고장났을 때\n기기 머리부분이 물에 들어갔을 때\n- 전원을 끄고 전원 케이블을 빼주세요.\n- 커버를 열고 필터를 빼주세요.\n- 커버를 약하게 흔들어 빠르게 내부의 물을 비워주세요.\n- 안전한 곳에 두고 24시간 동안 자연건조 해주세요.\n\n스위치를 켠 후, 기기가 작동하지 않을 때\n- 전원 케이블과 기기가 연결되어 있는지 확인하세요.\n- 전원 케이블의 사양을 확인하세요.\n- 물통에 물이 찼는지 확인하시고 필터가 완전히 젖은 상태인지 확인하세요.\n- 물이 부족하다면 적당한 양의 물을 물통에 넣어주세요.\n\n기기가 분무를 하지 않거나 분무에 이상이 있을 때\n- 분무 칩이 오염됐을 때 분무칩을 세척해주세요.\n- 필터가 오염되거나 심하게 오래됐을 때 교체해주세요.\n','2019-03-29 20:28:55','2019-03-29 20:28:55',NULL,2161),(5625,'사이즈: 가로 10.5 X 세로 12(cm)','2019-03-29 20:28:55','2019-03-29 20:28:55',NULL,2161),(5626,'재질:ABS','2019-03-29 20:28:55','2019-03-29 20:28:55',NULL,2161),(5627,'제조자: Xinfeng Eyun Aroma and Crafts Co., LTD.','2019-03-29 20:28:55','2019-03-29 20:28:55',NULL,2161),(5628,'원산지 : 중국\n','2019-03-29 20:28:55','2019-03-29 20:28:55',NULL,2161),(5629,'사이즈:  가