자레인지에 넣을 때 천이나 커버 등 다른 물건이 함께 들어가지 않도록 주의하세요.\n제품에 사용 적합한 전자레인지 사양은 600-700W입니다\n평균적으로 3-5시간동안 사용 가능하지만, 주변 환경의 온도에 따라 달라집니다.\n제품은 물로 세척해주세요. 사용하지 않을 때에는 서늘하고 건조한 곳에 보관해주세요.\n제품 안에 과다한 양의 물을 넣지 마세요. 제품의 2/3까지 채우는 것이 적합합니다.\n산성이나 알카리성 등 다른 화학 물질이 제품에 묻었을 경우 즉시 씻어내세요. 제품의 손상을 일으킬 수 있습니다.','2019-03-29 20:31:24','2019-03-29 20:31:24',NULL,2390),(6234,'가로 13.5cm x 세로 9cm x 높이 21cm','2019-03-29 20:31:24','2019-03-29 20:31:24',NULL,2390),(6235,'재질: silicone, nylon, pc','2019-03-29 20:31:24','2019-03-29 20:31:24',NULL,2390),(6236,'designed by Ko','2019-03-29 20:31:24','2019-03-29 20:31:24',NULL,2390),(6237,'재질 : PU(폴리카보네이트), PVC외','2019-03-29 20:31:24','2019-03-29 20:31:24',NULL,2392),(6238,'용량 : 887ml','2019-03-29 20:31:24','2019-03-29 20:31:24',NULL,2392),(6239,'주의사항:  \n용도 이외에는 사용하지 마세요.\n어린이의 손에 닿지 않는 곳에 보관하세요.\n운전이나 에어백 작동에 지장이 없는 장소에 부착해주세요.\n화기 근처나 고온의 장소에 보관하지 마세요.\n제품에 무리한 힘을 가하면 파손되오니 주의해주세요.\n잘못된 사용이나 주의사항 미준으로 인한 사고, 고장, 파손에 대해서 책임지지 않습니다.','2019-03-29 20:31:24','2019-03-29 20:31:24',NULL,2392),(6240,'사이즈 : 약 130(가로) x16(세로) x 2(높이)(mm) - 큐방제외 사이즈','2019-03-29 20:31:24','2019-03-29 20:31:24',NULL,2392),(6241,'designed by KJY','2019-03-29 20:31:24','2019-03-29 20:31:24',NULL,2392),(6242,'재질: 유포지(PP)','2019-03-29 20:31:24','2019-03-29 20:31:24',NULL,2389),(6243,'규격: 90x90mm','2019-03-29 20:31:24','2019-03-29 20:31:24',NULL,2389),(6244,'구성: 2매','2019-03-29 20:31:24','2019-03-29 20:31:24',NULL,2389),(6245,'재질: 유포지(PP)','2019-03-29 20:31:24','2019-03-29 20:31:24',NULL,2393),(6246,'규격: 101x82mm','2019-03-29 20:31:24','2019-03-29 20:31:24',NULL,2393),(6247,'구성: 2매','2019-03-29 20:31:24','2019-03-29 20:31:24',NULL,2393),(6248,'재질(렌즈 케이스):PVC','2019-03-29 20:31:24','2019-03-29 20:31:24',NULL,2391),(6249,'사이즈: 가로 8.2 X 세로 4.7 (cm)','2019-03-29 20:31:24','2019-03-29 20:31:24',NULL,2391),(6250,'사용연령: 만 14세 이상','2019-03-29 20:31:24','2019-03-29 20:31:24',NULL,2391),(6251,'주의사항 : 용도 외에는 사용하지 마세요./화기에 가까이 두지 마세요','2019-03-29 20:31:24','2019-03-29 20:31:24',NULL,2391),(6252,'재질